const Story = ({ story }) => {
    const {
      title,
      url,
      author,
      num_comments,
      points,
      image,
    } = story;

    return (
      <div className="story">
        <image>{image}</image>
        <span>
          <a href={url}>{title}</a>
        </span>
        <span>{author}</span>
        <span>{num_comments}</span>
        <span>{points}</span>
      </div>
    );
  }

  export default Story;
